import PropTypes from "prop-types";
import React, { memo } from "react";
import { SectionHeaderWrapper } from "./style";

const SectionHeader = memo((props) => {
  const { title } = props;
  return (
    <SectionHeaderWrapper>
      <h2>{title}</h2>
    </SectionHeaderWrapper>
  );
});

SectionHeader.propTypes = {};

export default SectionHeader;
